function MovCon(props) {
    return (
        <div className="movie-info">
            <img src={props.Poster_Link} alt="movie_img" />
            <h4 className="movie-info--title">Title: {props.Series_Title}</h4>
            <p className="movie-info--year">Year: {props.Released_Year}</p>
            <p className="movie-info--runtime">Runtime: {props.Runtime}</p>
            <p className="movie-info--genre">Genre: {props.Genre} users</p>
        </div>
    );
  }

  export default MovCon;
